import {FETCH_DATAS} from '../utilities/config';
const usersReducer = (state = {users:[]},action)=>
{
    switch(action.type)
    {
        case FETCH_DATAS:
            return {
                users : action.payload
            }
        default:
            return state;
    }
}
export default usersReducer;
